#include "../../template.hpp"

int sol(string s) {
    const int n = s.size();
    for (int i = 0; i < n; ++i) {
        if (isalpha(s[i])) {
            s[i] = ' ';
        }
    }
    unordered_set<string> ints;
    istringstream is(s);
    string word;
    while (is >> word) {
        if (word.empty()) continue;
        string temp;
        for (int i = 0; i < word.size(); ++i) {
            if (word[i] == '0' and temp.empty()) continue;
            temp += word[i];
        }
        ints.insert(temp);
    }
    return ints.size();
}

int main() { TimeMeasure _; //__x();
    cout << sol("a123bc34d8ef34") << endl; // 3
    cout << sol("leet1234code234") << endl; // 2
    cout << sol("a1b01c001") << endl; // 1
    cout << sol("167278959591294") << endl; // 1
    cout << sol("") << endl; // 3
    cout << sol("gi851a851q8510v") << endl; // 2
}
